            for (r1=0; r1<6; r1++) {

                    nodetxt = ""+board[r1][c1];	
                    nodecoord = tiles[r1*6+c1].id;

                    newpermSet.add([nodecoord, nodetxt]);

    function setup() {
        
        allpermsetsArr = allsets();
        solnsetsArr = allpermsetsArr;
        num = Math.floor(Math.random() * allpermsetsArr.length );


        permSet = allpermsetsArr[num];

        permsetIter = permSet.values();
        nodes = [];
        for (i1 of permsetIter)  {
            nodes.push(i1);
        }

        nodes.sort(function(){return 0.5 - Math.random()});
        pointer=0;
        visiblenodes = [];
        
        do {
            node1 = nodes[pointer];
            solnsetsarrLength = solnsetsArr.length;

            newsolnsetsArr = [];
            for (s1 in solnsetsArr) {
                possiblesoln = false;
                for (n1 of solnsetsArr[s1]) {
                    
                    if (node1[0]==n1[0] && node1[1]==n1[1]) {
                        possiblesoln = true;
                    }

                }
                if (possiblesoln) {
                    newsolnsetsArr.push(solnsetsArr[s1])
                }
            }

            solnsetsArr = newsolnsetsArr;
            if (solnsetsArr.length<solnsetsarrLength) {
                visiblenodes.push(node1);
            }

            pointer++;

        } while(solnsetsArr.length>1)

        
        solution(visiblenodes);


    }

    function solution(permSet) {
        for (n1 of permSet) {
            para = document.createElement("span");

            if (n1[1]=="1") {
                node = document.createTextNode(sun);
            } else if (n1[1]=="0") {
                node = document.createTextNode(moon);
            } else {
                node = document.createTextNode(n1[1]);
            }
            	
            para.appendChild(node);

            document.getElementById(n1[0]).appendChild(para);

            document.getElementById(n1[0]).style.color = "red";
        }

    }

    function checkwon() {
        tiles = document.getElementsByClassName("plyer");
        won = true;
        for (t1 in tiles) {
            if (t1.length<4) {
                if (tiles[t1].innerHTML.includes(moon)) {
                    testArr = [tiles[t1].id, 0];
                } else if (tiles[t1].innerHTML.includes(sun)) {
                    testArr = [tiles[t1].id, 1];
                } else {
                    won = false;
                }

                if (won) {
                    found = false;
                    for (p1 of permSet) {
                        if (p1[0]==testArr[0] && p1[1]==testArr[1]) {
                            found=true;
                        }
                    }
                    if (!found) {
                        won = false;
                    }
                }

                
            }
        }
        if (won) {
            setTimeout(myTimeout, 1500);
            function myTimeout() {
                alert("you won!");
            }
        }
    }

        }
